import React, { useState, useEffect } from 'react';
import '../styles/pages/AdminDashboard.css';

const AdminDashboard = () => {
  const [jobs, setJobs] = useState([]);
  const [editingJob, setEditingJob] = useState(null);

  // Fetch jobs from the backend
  useEffect(() => {
    // Replace with your API endpoint
    fetch('/api/jobs')
      .then((response) => response.json())
      .then((data) => setJobs(data))
      .catch((error) => console.error('Error fetching jobs:', error));
  }, []);

  // Handle job update
  const handleEdit = (job) => {
    setEditingJob(job);
  };

  const handleSave = () => {
    // Update the job via API
    fetch(`/api/jobs/${editingJob.id}`, {
      method: 'PUT',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(editingJob),
    })
      .then((response) => response.json())
      .then((updatedJob) => {
        setJobs((prevJobs) =>
          prevJobs.map((job) => (job.id === updatedJob.id ? updatedJob : job))
        );
        setEditingJob(null);
      })
      .catch((error) => console.error('Error updating job:', error));
  };

  return (
    <div className="admin-dashboard">
      <header className="dashboard-header">
        <h1>Admin Dashboard</h1>
        <p>Manage jobs, users, and platform performance here.</p>
      </header>

      {/* Job Management Section */}
      <section className="job-management">
        <h2>Manage Jobs</h2>
        <table className="job-table">
          <thead>
            <tr>
              <th>Job ID</th>
              <th>Title</th>
              <th>Status</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {jobs.map((job) => (
              <tr key={job.id}>
                <td>{job.id}</td>
                <td>{job.title}</td>
                <td>{job.status}</td>
                <td>
                  <button onClick={() => handleEdit(job)}>Edit</button>
                  <button>Delete</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </section>

      {/* Edit Job Modal */}
      {editingJob && (
        <div className="edit-modal">
          <div className="modal-content">
            <h2>Edit Job</h2>
            <form>
              <label>
                Title:
                <input
                  type="text"
                  value={editingJob.title}
                  onChange={(e) =>
                    setEditingJob({ ...editingJob, title: e.target.value })
                  }
                />
              </label>
              <label>
                Status:
                <select
                  value={editingJob.status}
                  onChange={(e) =>
                    setEditingJob({ ...editingJob, status: e.target.value })
                  }
                >
                  <option value="active">Active</option>
                  <option value="completed">Completed</option>
                  <option value="pending">Pending</option>
                </select>
              </label>
              <button type="button" onClick={handleSave}>
                Save
              </button>
              <button type="button" onClick={() => setEditingJob(null)}>
                Cancel
              </button>
            </form>
          </div>
        </div>
      )}
    </div>
  );
};

export default AdminDashboard;
